import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Container, Grid } from '@mui/material';
import { motion } from 'framer-motion';

export default function Home() {
  const navigate = useNavigate();

  const navigateTo = (page) => {
    navigate(`/${page}`);
  };

  const styles = {
    button: {
      margin: '20px',
      padding: '15px 30px',
      fontSize: '18px',
      borderRadius: '25px',
      transition: 'transform 0.3s ease',
      '&:hover': {
        transform: 'scale(1.1)',
      },
    },
    container: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
    },
  };

  return (
    <Container style={styles.container}>
      <Grid container justifyContent="center">
        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <Button
            variant="contained"
            color="primary"
            style={styles.button}
            onClick={() => navigateTo('checkBill')}
          >
            Checkbill
          </Button>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.2 }}
        >
          <Button
            variant="contained"
            color="secondary"
            style={styles.button}
            onClick={() => navigateTo('statusdebtor')}
          >
            Summary Slip
          </Button>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.2 }}
        >
          <Button
            variant="contained"
            color="secondary"
            style={styles.button}
            onClick={() => navigateTo('statusdebtor')}
          >
            Status Debtor
          </Button>
        </motion.div>
      </Grid>
    </Container>
  );
}
